import React from 'react';
import Menu from './Menu';
import angel from './angel.png';
import devil from './devil.png';

function Hero(){
    return(
        <>

        <div className='HeroSection'>
            <div className='Navbar'><Menu /></div>
            <div className='Header_logo'><h1>NFT LOGO.</h1></div>
            <div className='container'>
                <div className='firstgroup'>
                    <h1>Get Your Devil & Angel NFT</h1>
                    <button>Buy NFT</button>
                </div>

                <div className='secondgroup'>
                    <img className='imgone' src={devil} alt="Girl in a jacket" />
                    <img className='imgtwo' src={angel} alt="Girl in a jacket" /> 
                </div>

            </div>
        </div>

        
        </>
    )
}

export default Hero;
